import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  const initialCourses = [
    { 
      id: "linux", title: "Linux Admin", price: "55,000 MMK", duration: "2 Months", 
      req: "Basic Computer Knowledge", img: "https://images.unsplash.com/photo-1629654297299-c8506221ca97?q=80&w=1000", 
      detail: "Master Linux CLI, Server Management, and Security Auditing." 
    },
    { 
      id: "cyber", title: "Cyber Security", price: "75,000 MMK", duration: "3 Months", 
      req: "Network Basics", img: "https://images.unsplash.com/photo-1550751827-4bd374c3f58b?q=80&w=1000", 
      detail: "Learn Threat Hunting, SOC Analysis, and Incident Response." 
    },
    { 
      id: "net", title: "Networking", price: "45,000 MMK", duration: "2 Months", 
      req: "None", img: "https://images.unsplash.com/photo-1544197150-b99a580bb7a8?q=80&w=1000", 
      detail: "CCNA level Networking, Protocols, and Firewall Configuration." 
    },
    { 
      id: "py_basic", title: "Python Basic", price: "40,000 MMK", duration: "1.5 Months", 
      req: "Logical Thinking", img: "https://images.unsplash.com/photo-1526374965328-7f61d4dc18c5?q=80&w=1000", 
      detail: "Fundamentals of Programming, Automation, and Scripting." 
    },
    { 
      id: "py_adv", title: "Python Adv", price: "60,000 MMK", duration: "2 Months", 
      req: "Python Basics", img: "https://images.unsplash.com/photo-1515879218367-8466d910aaa4?q=80&w=1000", 
      detail: "Deep dive into OOP, Web Frameworks, and Data Analysis." 
    },
    { 
      id: "hacking", title: "World Hacking", price: "95,000 MMK", duration: "4 Months", 
      req: "Linux & Networking", img: "https://images.unsplash.com/photo-1563986768609-322da13575f3?q=80&w=1000", 
      detail: "Real-world Pentesting, Bug Bounty, and Exploitation Techniques." 
    }
  ];

  const [courses, setCourses] = useState(initialCourses);
  const [selectedCourse, setSelectedCourse] = useState(null);

  const handleNext = () => {
    const newItems = [...courses];
    newItems.push(newItems.shift());
    setCourses(newItems);
  };

  const handlePrev = () => {
    const newItems = [...courses];
    newItems.unshift(newItems.pop());
    setCourses(newItems);
  };

  const handleCardClick = (index) => {
    if (index >= 2) handleNext();
    if (index === 0) handlePrev();
  };

  return (
    <div style={styles.body}>
      {/* Navbar - Responsive */}
      <nav style={styles.nav}>
        <h2 style={{ color: '#00ff41', margin: 0 }}>CYBER_SHIELD</h2>
        <div style={styles.navRight}>
          <Link to="/login" style={styles.navLink}>LOGIN</Link>
          <Link to="/register" style={styles.regBtn}>JOIN</Link>
        </div>
      </nav>

      {/* Main Container - Responsive */}
      <div style={styles.container}>
        <div style={styles.slide}>
          {courses.map((course, index) => (
            <div 
              key={course.id}
              onClick={() => handleCardClick(index)}
              style={{
                ...styles.item,
                backgroundImage: `url(${course.img})`,
                width: index < 2 ? '100%' : '150px',
                height: index < 2 ? '100%' : '220px',
                left: index < 2 ? '0' : `calc(55% + ${(index - 2) * 170}px)`,
                top: index < 2 ? '0' : '65%',
                opacity: index >= 5 ? 0 : 1,
                zIndex: index < 2 ? 1 : 10,
                borderRadius: index < 2 ? '0' : '15px',
                display: index >= 6 ? 'none' : 'block'
              }}
            >
              {index === 1 && (
                <div style={styles.content}>
                  <div style={styles.name}>{course.title}</div>
                  <div style={styles.des}>{course.detail}</div>
                  <button style={styles.seeMoreBtn} onClick={(e) => { e.stopPropagation(); setSelectedCourse(course); }}>
                    MISSION BRIEFING
                  </button>
                </div>
              )}
            </div>
          ))}
        </div>

        {/* Buttons - Adjusted position */}
        <div style={styles.buttonContainer}>
          <button style={styles.navBtn} onClick={handlePrev}>‚ùÆ</button>
          <button style={styles.navBtn} onClick={handleNext}>‚ùØ</button>
        </div>
      </div>

      {/* Modal - Expanded with Price, Duration, Requirements */}
      {selectedCourse && (
        <div style={styles.modalOverlay} onClick={() => setSelectedCourse(null)}>
          <div style={styles.modalContent} onClick={e => e.stopPropagation()}>
            <h2 style={{ color: '#00ff41', marginTop: 0 }}>[ MISSION: {selectedCourse.title} ]</h2>
            <div style={styles.infoGrid}>
              <div style={styles.infoBox}><span>üí∞ Price:</span> {selectedCourse.price}</div>
              <div style={styles.infoBox}><span>‚è≥ Duration:</span> {selectedCourse.duration}</div>
              <div style={styles.infoBox}><span>üîë Requirements:</span> {selectedCourse.req}</div>
            </div>
            <p style={{ lineHeight: '1.6', color: '#ccd6f6', borderTop: '1px solid #233554', paddingTop: '15px' }}>
              {selectedCourse.detail}
            </p>
            <div style={{ marginTop: '25px', display: 'flex', gap: '10px' }}>
                <Link to="/register" style={styles.modalJoinBtn}>ENROLL MISSION</Link>
                <button style={styles.closeBtn} onClick={() => setSelectedCourse(null)}>ABORT</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

const styles = {
  body: { backgroundColor: '#0a192f', height: '100vh', overflow: 'hidden', fontFamily: 'monospace' },
  nav: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '15px 5%', background: 'rgba(10, 25, 47, 0.9)', position: 'fixed', width: '90%', zIndex: 1000 },
  navRight: { display: 'flex', gap: '15px', alignItems: 'center' },
  navLink: { color: '#ccd6f6', textDecoration: 'none', fontSize: '14px' },
  regBtn: { padding: '7px 15px', border: '1px solid #00ff41', color: '#00ff41', textDecoration: 'none', borderRadius: '4px' },

  container: { position: 'relative', width: '100%', height: '100%', overflow: 'hidden' },
  slide: { width: '100%', height: '100%' },
  item: { position: 'absolute', backgroundPosition: 'center', backgroundSize: 'cover', transition: '0.7s ease-in-out' },

  content: { position: 'absolute', top: '40%', left: '10%', width: '80%', maxWidth: '400px', color: '#eee', zIndex: 20 },
  name: { fontSize: 'clamp(24px, 5vw, 48px)', fontWeight: 'bold', color: '#00ff41', textShadow: '2px 2px 10px #000' },
  des: { margin: '15px 0', fontSize: '14px', textShadow: '1px 1px 5px #000' },
  seeMoreBtn: { padding: '10px 20px', border: 'none', cursor: 'pointer', background: '#00ff41', color: '#0a192f', fontWeight: 'bold' },

  buttonContainer: { position: 'absolute', bottom: '10%', left: '10%', display: 'flex', gap: '15px', zIndex: 100 },
  navBtn: { width: '40px', height: '40px', borderRadius: '50%', border: '1px solid #00ff41', background: 'rgba(0,0,0,0.5)', color: '#00ff41', cursor: 'pointer' },

  modalOverlay: { position: 'fixed', top: 0, left: 0, width: '100%', height: '100%', background: 'rgba(0,0,0,0.85)', display: 'flex', justifyContent: 'center', alignItems: 'center', zIndex: 2000 },
  modalContent: { background: '#112240', padding: '30px', borderRadius: '10px', border: '1px solid #00ff41', width: '90%', maxWidth: '450px' },
  infoGrid: { display: 'flex', flexDirection: 'column', gap: '10px', marginBottom: '15px' },
  infoBox: { fontSize: '14px', color: '#8892b0', background: '#0a192f', padding: '8px', borderRadius: '4px' },
  modalJoinBtn: { flex: 1, textAlign: 'center', padding: '10px', background: '#00ff41', color: '#0a192f', textDecoration: 'none', fontWeight: 'bold', borderRadius: '4px' },
  closeBtn: { padding: '10px', background: 'transparent', border: '1px solid #ff4b2b', color: '#ff4b2b', borderRadius: '4px', cursor: 'pointer' }
};

export default Home;
